mutation createContactAssignmentEntry($contactId: Int!, $assignedBy: String!, $assignedTo: String) {
  createContactAssignmentEntry(input: {contactId: $contactId, assignedBy: $assignedBy, assignedTo: $assignedTo}) {
    __typename
    id
    createdAt
    contactId
    assignedBy
    assignedTo
  }
}

